import React, {component, Component} from 'react';
import {Bar,Line,Pie} from 'react-chartjs-2';

class Chart extends Component{
    render(){
        return(
            <div className="chartTitle">
               <h1 className="mb-4">Report Graph</h1>
            </div>
        )
    }
}

export default Chart;
